def prime_factors(numbers):
    number = numbers[80]
    primes = []
    i = 2
    while i * i <= number:
        if number % i:
            i += 1
        else:
            number //= i
            primes.append(i)
    if number > 1:
        primes.append(number)
    return set(primes)
```

Note: If the index given (80 in this case) is out of the range of the list, the function will throw an IndexError: list index out of range. Make sure to pass a list of at least 81 elements to avoid this error.
